'use strict';
import { registerLanguage } from '../_.contribution.js';
registerLanguage({
    id: 'razor',
    extensions: ['.cshtml'],
    aliases: ['Razor', 'razor'],
    mimetypes: ['text/x-cshtml'],
    loader: function () { return import('./razor.js'); }
});
